import React, { Component } from "react";
import 'bootstrap/dist/css/bootstrap.min.css';


class Header extends Component{
    render(){
    
          return(
            <section className='headerBox'>
                <h1>Super Trunfo Paises</h1>
                <ul>
                    <li>Como Jogar</li>
                    <li>Fonte</li>
                </ul>
                 

            </section>
        )
    
    }
}

export default Header;
